subSubSection.paragraph:
Cell V obtriangular, half of the length of cell IV, not connected with cell III. Outer appendage with the lower dorsal margin ± obscured; once branched above the suprabasal cell. Inner appendage consisting of a basal cell slightly shorter and narrower than basal cell of outer appendage, supporting a variable number of sterile and fertile branches bearing paired lateral antheridia. [Detailed descriptions: 
Sugiyama 1973
; 
Majewski 1994b
; 
Santamaria 1998
; 

Villarreal 
et al.
2010

; 
De Kesel & Gerstmans 2011
]

Laboulbenia flagellata
is a very common and cosmopolitan species found on the five continents, infecting not less than 12 tribes and more than 80 genera of ground beetles (
Santamaria et al. 1991
; Majewski 2008 ;
Haelewaters et al. 2019b
). Early reported in Denmark by Rostrup (1916 , 1935 ).

